import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 18.2-346 Prostitution; commercial sexual conduct; penalties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-346.md","filePath":"vacode/18.2-346.md"}'),o={name:"vacode/18.2-346.md"},i=r('<h1 id="§-18-2-346-prostitution-commercial-sexual-conduct-penalties" tabindex="-1">§ 18.2-346 Prostitution; commercial sexual conduct; penalties. <a class="header-anchor" href="#§-18-2-346-prostitution-commercial-sexual-conduct-penalties" aria-label="Permalink to &quot;§ 18.2-346 Prostitution; commercial sexual conduct; penalties.&quot;">​</a></h1><p>Any person who, for money or its equivalent, (i) commits any act in violation of § <a href="/vacode/18.2-361/">18.2-361</a>; performs cunnilingus, fellatio, or anilingus upon or by another person; engages in sexual intercourse or anal intercourse; touches the unclothed genitals or anus of another person with the intent to sexually arouse or gratify; or allows another to touch his unclothed genitals or anus with the intent to sexually arouse or gratify or (ii) offers to commit any act in violation of § <a href="/vacode/18.2-361/">18.2-361</a>; perform cunnilingus, fellatio, or anilingus upon or by another person; engage in sexual intercourse or anal intercourse; touch the unclothed genitals or anus of another person with the intent to sexually arouse or gratify; or allow another to touch his unclothed genitals or anus with the intent to sexually arouse or gratify and thereafter does any substantial act in furtherance thereof is guilty of prostitution, which is punishable as a Class 1 misdemeanor.</p><p>Code 1950, § 18.1-194; 1960, c. 358; 1975, cc. 14, 15; 1980, c. 534; 1993, c. 609; 2013, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0417" target="_blank" rel="noreferrer">417</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0467" target="_blank" rel="noreferrer">467</a>; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>; 2020, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0122" target="_blank" rel="noreferrer">122</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0595" target="_blank" rel="noreferrer">595</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0900" target="_blank" rel="noreferrer">900</a>; 2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0188" target="_blank" rel="noreferrer">188</a>.</p>',3),n=[i];function l(s,c,u,h,g,f){return t(),a("div",null,n)}const d=e(o,[["render",l]]);export{_ as __pageData,d as default};
